  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Moosehorn
  NWR outlines Refuge accomplishments during the 1970 calendar year. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover conditions during the year. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
  fish, reptiles, and diseases- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, collections and receipts, vegetation
  control, and prescribed burning. Resource management is outlined; topics include
  grazing, haying, fur harvesting, and timber removal. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, violations, and safety. Items of interest, N-R forms, and photographs are
  attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
